class MHDSuite:
    def peakmem_run_sim(self):
        self.run_sim()

    def setup(self):
        n = 512
        nt = 10 * int(n / 32)
        t_stop = 0.05
        dt = t_stop / nt
        gamma = 5.0 / 3.0
        box_size = 1.0

        self.params = {
            "physics": {
                "hydro": True,
                "magnetic": True,
                "quantum": False,
                "gravity": False,
            },
            "mesh": {
                "type": "cartesian",
                "resolution": [n, n],
                "boxsize": [box_size, box_size],
            },
            "simulation": {
                "stop_time": t_stop,
                "timestep": dt,
                "n_timestep": nt,
            },
            "hydro": {
                "eos": {"type": "ideal", "gamma": gamma},
            },
        }

